(1092, 484, '_form', '<label> Nomor Pesanan\n    [text* your-subject] </label>\n\n<label> Nama\n    [text* your-name] </label>\n\n<label> Email\n    [email* your-email] </label>\n\n<label> Nomor Rekening Anda\n    [text* your-rekening] </label>\n\n<label> Nominal Transfer\n    [text* your-transfer] </label>\n\n<label> Upload Bukti Transfer\n[file* file-776 limit:5000000] </label>\n\n[submit \"Kirim Bukti Pembayaran\"]'),
(1093, 484, '_mail', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:47:\"Pembayaran untuk Pesanan Nomor \"[your-subject]\"\";s:6:\"sender\";s:47:\"Toko Bu Entar <wordpress@tokobuentar.epizy.com>\";s:9:\"recipient\";s:18:\"dwitasmd@gmail.com\";s:4:\"body\";s:434:\"From: [your-name] <[your-email]>\nSubject: Pemmbayaran dengan Nomor Pesanan [your-subject]\n\n\nPesanan telah berhasil dibayarkan dengan rincian sebagai berikut :\nNomor Pesanan        : [your-subject]\nNama Pembeli         : [your-name]\nNomor Rekening       : [your-rekening]\nTransfer ke Rekening : [your-transfer]\nMohom segera ditindaklanjuti dan update status pesanan apabila pembayaran sudah berhasil masuk ke rekening anda. Terimakasih\";s:18:\"additional_headers\";s:22:\"Reply-To: [your-email]\";s:11:\"attachments\";s:10:\"[file-776]\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
(1094, 484, '_mail_2', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:47:\"Pembayaran untuk Pesanan Nomor \"[your-subject]\"\";s:6:\"sender\";s:47:\"Toko Bu Entar <wordpress@tokobuentar.epizy.com>\";s:9:\"recipient\";s:12:\"[your-email]\";s:4:\"body\";s:349:\"Pembayaran telah berhasil dikirim, kami akan memprosesnya dan mengupdate status pesanan anda. \nRincian Pembayaran\nNomor Pesanan        : [your-subject]\nNama Anda            : [your-name]\nNomor Rekening       : [your-rekening]\nTransfer ke Rekening : [your-transfer]\nKami akan segera menghubungi anda kembali. Terimakasih sudah berbelanja di toko kami\";s:18:\"additional_headers\";s:28:\"Reply-To: dwitasmd@gmail.com\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
