(484, 1, '2021-06-18 23:03:11', '2021-06-18 23:03:11', '<label> Nomor Pesanan\r\n    [text* your-subject] </label>\r\n\r\n<label> Nama\r\n    [text* your-name] </label>\r\n\r\n<label> Email\r\n    [email* your-email] </label>\r\n\r\n<label> Nomor Rekening Anda\r\n    [text* your-rekening] </label>\r\n\r\n<label> Nominal Transfer\r\n    [text* your-transfer] </label>\r\n\r\n<label> Upload Bukti Transfer\r\n[file* file-776 limit:5000000] </label>\r\n\r\n[submit \"Kirim Bukti Pembayaran\"]\n1\nPembayaran untuk Pesanan Nomor \"[your-subject]\"\nToko Bu Entar <wordpress@tokobuentar.epizy.com>\ndwitasmd@gmail.com\nFrom: [your-name] <[your-email]>\r\nSubject: Pemmbayaran dengan Nomor Pesanan [your-subject]\r\n\r\n\r\nPesanan telah berhasil dibayarkan dengan rincian sebagai berikut :\r\nNomor Pesanan        : [your-subject]\r\nNama Pembeli         : [your-name]\r\nNomor Rekening       : [your-rekening]\r\nTransfer ke Rekening : [your-transfer]\r\nMohom segera ditindaklanjuti dan update status pesanan apabila pembayaran sudah berhasil masuk ke rekening anda. Terimakasih\nReply-To: [your-email]\n[file-776]\n\n\n1\nPembayaran untuk Pesanan Nomor \"[your-subject]\"\nToko Bu Entar <wordpress@tokobuentar.epizy.com>\n[your-email]\nPembayaran telah berhasil dikirim, kami akan memprosesnya dan mengupdate status pesanan anda. \r\nRincian Pembayaran\r\nNomor Pesanan        : [your-subject]\r\nNama Anda            : [your-name]\r\nNomor Rekening       : [your-rekening]\r\nTransfer ke Rekening : [your-transfer]\r\nKami akan segera menghubungi anda kembali. Terimakasih sudah berbelanja di toko kami\nReply-To: dwitasmd@gmail.com\n\n\n\nBukti pembayaran berhasil dikirim, harap periksa email yang kami kirimkan kepada anda.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Konfirmasi Pembayaran', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2021-06-19 09:06:43', '2021-06-19 09:06:43', '', 0, 'http://tokobuentar.epizy.com/?post_type=wpcf7_contact_form&#038;p=484', 0, 'wpcf7_contact_form', '', 0),
